import React, { useState } from "react";
import { Link } from "react-router-dom";
import MenuIcon from '@mui/icons-material/Menu';
import "../css/Navbar.css";

function Navbar() {
  const [openLinks, setOpenLinks] = useState(false);

  const toggleNavbar = () => {
    setOpenLinks(!openLinks);
  };
  return (
    <header className="top-area">
    <div className="header-area">
      <nav className="navbar navbar-default bootsnav navbar-fixed dark no-background">

          <div className="container">
              <div className="navbar-header">
                  <button type="button" className="navbar-toggle" data-toggle="collapse" data-target="#navbar-menu">
                      <i className="fa fa-bars"></i>
                  </button>
                  {/* <Link className="navbar-brand" to="#">Your Logo</Link> */}
              </div>


              <div className="collapse navbar-collapse menu-ui-design" id="navbar-menu">
                  <ul className="nav navbar-nav navbar-right" data-in="fadeInDown" data-out="fadeOutUp">
                  <li className=" smooth-menu active"></li>
                      <li className=" smooth-menu"><a href="#aboutUs">About Us</a></li>
                      <li className="smooth-menu"><a href="#feature">Core Feature</a></li>
                      <li className="smooth-menu"><a href="#profiles">profile</a></li>
                      <li className="smooth-menu"><a href="#portfolio">portfolio</a></li>
                      <li className="smooth-menu"><a href="#contact">contact</a></li>
                  </ul>
              </div>
          </div>
      </nav>
    </div>

    <div className="clearfix"></div>

  </header>
  );
}

export default Navbar;
